import React, { Component } from 'react'

export default class RewardsCard extends Component {
  constructor(props) {
    super(props);
      this.state = {
        purchaseN: this.props.purchased,
        totalR: 0
    };
  }

  render() {
    // console.log("totalR", this.state.totalR);
    return (
      <div>
        <p>{this.props.date}</p>
        <p>{this.props.purchase}</p>
        <p>{this.props.rewardpoints}</p>
      </div>
    )
  }
}
